    false,nt"url": null,nt"notes": "This annual narrative report for Audubon
    National Wildlife Refuge, Lake Nettie Refuge, and McLean Refuge outlines Refuge
    accomplishments during the 1980 calendar year. The report begins with a summary
    of the year's highlights and weather conditions. The report includes a planning
    section which discusses public participation and research and investigations. Refuge
    administration is outlined; information about personnel, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    croplands, grasslands, grazing, and pest control. The wildlife section of the report
    discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, game mammals, fisheries resources, scientific collections, animal control,
    and marking and bird banding. The public uses of the Refuge described in this report
    include hunting, fishing, trapping, wildlife observation, and law enforcement. The
    equipment and facilities section of the report provides information about new construction,
    major maintenance, equipment replacement, communication systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"license_title":
